import React,{Component} from "react";

import Menu from "./Menu";
import Navbar from "./Navbar";

export default class App extends Component{
    render(){
        return(
            <div className="container">
                <Menu/>
                <div className="row">
                    <Navbar/>
                </div>
            </div>
        )
    }
}
